import { StyleSheet } from "react-native";

export default StyleSheet.create({
  container: {
    height: 50,
    backgroundColor: "#222222",
    justifyContent: "flex-start",
    alignItems: "flex-start",
    justifyContent: "center",
    paddingLeft: 100,
  },
  text: {
    fontSize: 30,
  },
});
